stopwords.add("will")

stopwords.add("say")

stopwords.add("said")

stopwords.add("let")

stopwords.add("vote")

stopwords.add("now")

stopwords.add("go")
wordcloud_hc = WordCloud(max_font_size=40, relative_scaling=.5,stopwords=stopwords).generate(df_hc['text'].str.cat())

plt.figure()

plt.imshow(wordcloud_hc)

plt.axis("off")

plt.show()
wordcloud_dt = WordCloud(max_font_size=40, relative_scaling=.5,stopwords=stopwords).generate(df_dt['text'].str.cat())

plt.figure()

plt.imshow(wordcloud_dt)

plt.axis("off")

plt.show()
